oxy_webhelp_navlinks = {"rep_set_up_as_roaming_t-d4800e5914":{"topics":[{"title":"How do I configure my Notes workspace for roaming?","shortdesc":"<p class=\"shortdesc\">As a roaming user, your Notes workspace can participate as a roaming application. This enables you to share a single Notes® workspace, including tabs and application chicklets, on all Notes clients on which you work as a Notes roaming user. <\/p>","href":"rep_config_workspace_roaming_t.html","attributes":{"data-id":"rep_config_workspace_roaming_"},"menu":{"hasChildren":false},"tocID":"rep_config_workspace_roaming_-d4800e5932","topics":[]},{"title":"What roaming preferences can I set?","shortdesc":"<p class=\"shortdesc\">Use the Notes® Roaming preferences panel to temporarily enable or disable roaming and specify whether to use local or remote replication for file server roaming. .<\/p>","href":"pref_roaming_file_server_r.html","attributes":{"data-id":"pref_roaming_file_server_r"},"menu":{"hasChildren":false},"tocID":"pref_roaming_file_server_r-d4800e5956","topics":[]}]}};